import React from "react";

const ProductList = ({ products }) => {
  return (
    <div id="product-list">
      <header>
        <strong>{`Product List (${products.length} items)`}</strong>
      </header>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Department</th>
            <th>Price</th>
          </tr>
        </thead>
        <tbody>
          {
            /* Display products here in new table rows */
            products.map(function ({ id, name, department, currency, price }) {
              return (
                <tr key={id}>
                  <td>{id}</td>
                  <td>{name}</td>
                  <td>{department}</td>
                  <td>{price}</td>
                </tr>
              );
            })
          }
        </tbody>
      </table>
    </div>
  );
};

export default ProductList;
